import React from "react";
import "./ProfileCard.scss";
function ProfileCard() {
  return (
    <div className="ProfileCard">
      <div className="imageContainer">
        <img
          alt="avatar"
          src="https://lh3.googleusercontent.com/-ExcCE_u-6AA/AAAAAAAAAAI/AAAAAAAAAAA/ACHi3re0f6aLElaFPaWzTzCEPQKovJ8fsw/s96-c/photo.jpg"
        ></img>
      </div>
      <p>14 Points</p>
    </div>
  );
}

export default ProfileCard;
